import Input from '@mui/material/Input';
import Select from '@mui/material/Select';
import MenuItem from '@mui/material/Option';
import './style.css';

const Component1 = () => {
  return (
    <div className='component1'>
      <h2>Create a project</h2>
      <br />
      <h3>Name</h3>
      <Input slotProps={{ input: { className: 'input-box' } }} />
      <h3>Type</h3>
      <Select slotProps={{ listbox: { className: 'input-box' } }}>
        <MenuItem value="#F00">Red</MenuItem>
        <MenuItem value="#0F0">Green</MenuItem>
        <MenuItem value="#00F">Blue</MenuItem>
      </Select>
    </div>
  );
};

export default Component1;
